function capitalizeFirst(arr) {
    let newArr = []
    let currentArrIndex = 0
    let currentWord = ''
    
    function helper(input, length) {
        if(currentArrIndex === input.length) return
        
        reArrage(input[currentArrIndex], 0)
        newArr.push(currentWord)
        currentWord = ''
        currentArrIndex++
        
        helper(input, currentArrIndex)
    }

    function reArrage(str, strIndex) {
        if(strIndex === str.length){
            return currentWord
        }
        currentWord += strIndex === 0 ? str[strIndex].toUpperCase() : str[strIndex].toLowerCase()
        strIndex++
        reArrage(str, strIndex)
    }
    helper(arr)
    return newArr
}

function capitalizeFirstLoop(arr) {
    let newArr = []
    for(let i = 0; i < arr.length;i++) {
        let currentWord = arr[i].toLowerCase()
        currentWord = currentWord[0].toUpperCase() + currentWord.slice(1)
        newArr.push(currentWord)
    }
    return newArr
}

function capitalizeFirstAlgo(array) {
    if(array.length === 1){
        return [array[0].toUpperCase()];
    }

    let res = capitalizeFirst(array.slice(0, -1));
    res.push(array.slice(array.length - 1)[0].toUpperCase());
    return res;
}

